// RecipeList.js
import React from 'react';

function RecipeList({ recipes }) {
  return (
    <ul>
      {recipes.map(recipe => (
        <li key={recipe._id}>{recipe.name}</li>
      ))}
    </ul>
  );
}

export default RecipeList;
